                BeginContext(1320, 4342, true);
                WriteLiteral(@"КЦ Алеана предлагает авторскую программу стажировки для стажеров-оценщиков с целью получения квалификационного свидетельства оценщика и молодых специалистов, которые хотят получить углубленный опыт в практике оценочной деятельности.</p>
                <p class=""abzac"" style=""text-align: justify;""><em>Руководитель стажировки - <strong>Мельниченко Елена Дмитриевна</strong> – руководитель оценочной компании, председатель Днепропетровского областного отделения Ассоциации специалистов оценки, председатель Днепропетровского областного отделения Союза оценщиков земли, </em><em>эксперт-оценщик высшей категории сертифицированный <a href=""http://afo.com.ua/ru/myprofile/userprofile/187"" target=""_blank"">«Ассоциацией специалистов оценки»</a> (АФО)<span style=""font-style: italic;"">, доцен</span></em><span style=""font-style: italic;"">т НМетАУ, преподаватель Института последипломного образования  Днепропетровского университета экономики и права. Стаж работы в оценочной деятельности - 18 лет.</span></p>
                <p ");
                WriteLiteral(@"class=""abzac"">Программа включает эксклюзивные подходы при подготовке специалистов в области оценки.</p>
                <p class=""abzac"">Стажировка предполагает приобретение практических навыков наряду с  укреплением и детализацией теоретических знаний, которые позволят Вам самостоятельно проводить оценку объектов.</p>
                <p class=""podzagolovok1"" style=""margin-left:25px;"">Пройдя стажировку в нашем центре, вы сможете:</p>
                <ul>
                    <li> успешно позиционировать себя при трудоустройстве в оценочную компанию;</li>
                    <li> выполнять самостоятельно оценочные работы с соблюдением требований стандартов и др. нормативных документов;</li>
                    <li> консультироваться по различным вопросам практической деятельности у руководителя стажировки в течение 3 лет;</li>
                    <li> подготовиться к квалификационным экзаменам, сдать пробный экзамен;</li>
                    <li> получить рекомендацию Центра стажировки для сдачи экзамен");
                WriteLiteral(@"а и дальнейшего трудоустройства;</li>
                    <li> стажироваться в действующей оценочной компании и получить практический опыт.</li>
                </ul>
                <p class=""podzagolovok1"" style=""margin-left:25px;"">Стажировка включает:</p>
                <ol>
                    <li> Теоретические семинары, углубленное изучение методических подходов. Проведение семинаров-тренингов (занятия в группе, практическая работа стажеров). Круглый стол.</li>
                    <li> Проведение выездных практических занятий по оценке объектов различного функционального  назначения. Участие в практической работе компании. Консультации при выполнении отчетов.</li>
                    <li> Тематические консультации специалистов. В процессе оценочной деятельности оценщику приходится часто сталкиваться с юридическими, финансовыми, техническими вопросами смежных профессий. Мы приглашаем лучших специалистов - юристов, специалистов БТИ, риелторов, аудиторов.</li>
                    <li> Индивидуальн");
                WriteLiteral(@"ые консультации с руководителем стажировки.</li>
                    <li> Интернет-консультации.</li>
                    <li> Обеспечение необходимой методической литературой.</li>
                    <li> Помощь в подготовке к квалификационным экзаменам.</li>
                    <li> При успешной сдаче квалификационных экзаменов- содействие в трудоустройстве.</li>
                </ol>
                <p class=""abzac"">Регионы очного обучения – Днепропетровская, Запорожская, Кировоградская, Харьковская, Донецкая области, г. Киев.</p>
                <p class=""abzac"">Возможность дистанционного обучения стажеров из других областей Украины. Стажировка проводится в соответствии с программой учебных центров по подготовке оценщиков.</p>
                <p class=""abzac"">В процессе стажировки Вы приобретете самое ценное – практические навыки при оценке имущества, которые сможете применить при самостоятельной работе.</p>
                <p><strong>Стоимость стажировки составляет 10 000 грн. в год.</strong></");
                WriteLiteral("p>\r\n                <p></p>\r\n                <p><strong>Телефоны: (056) 767-60-02, (063) 930-23-04, (066) 756-70-81, (098) 756-49-03</strong></p>\r\n            </td>\r\n        </tr>\r\n    </table>\r\n    <span class=\"article_separator\">&nbsp;</span>\r\n");
